    false,nt"url": null,nt"notes": "This report summarizes the results of vegetation
    transects conducted in millet ponds A, B, and C; goose pasture; supply pond; and
    fields 4A, 4B, 21, and 22 of Clarence Cannon NWR. The purpose of the study was to
    determine the major plant species and their overall abundance within each of the
    studied areas. Each plant species was ranked and categorized as to (a) the number
    of plot sites it occurred  on; (b) what percentage of the total sites it was found
    on; (c) total vegetation; and (d) what percentage of the total vegetative yield
    this would be for each site.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
